    LANGUAGE plpgsql
    AS $$
BEGIN
  IF NEW.status = 'confirmed'
     AND (OLD.status IS DISTINCT FROM 'confirmed' OR OLD.confirmed_at IS NULL) THEN

      order_id,
      product_id,
      sale_date,
      quantity_sold,
      initial_profit
    )
