      NEW.product_id,
      NEW.confirmed_at,
      NEW.number_of_devices,
      (p.selling_price - p.cost_price) * NEW.number_of_devices
    FROM products p
    WHERE p.id = NEW.product_id;
  END IF;

  RETURN NEW;
END;
$$;


